import React from "react";
import s from "./AboutUsPage.module.css";
import Logo from "../../assets/images/sousmate.png";
import Team from "../../assets/images/team.jpg";
import { Image, Card } from "../ui";

export default function AboutUsPage() {
  return (
    <div className={s.AboutUsPage}>
      <h1>About Us</h1>

      <Image src={Logo} alt="Sousmate Logo" imgClass={s.Logo} />

      <Card
        text="Sousmate has existed more than 10 years, and we have about 1 million
        subscribers. We like to cook like you, and we are glad to help you make
        your favorite recipes and simplify this process."
        cardClass={s.AboutUsMsg}
      />

      <Image src={Team} alt="Sousmate team" imgClass={s.Team} />

      <Card
        text={`Sousmate has about 100 employees, and our site is constantly being
        improved and updated so that you can easily find the recipes that suit
        your whole family, and according to the time you have to cook it. ${(
          <span>Enjoy cooking even more with us!</span>
        )}`}
        cardClass={s.AboutUsMsg}
      />
      <p className={s.AboutUsMsg2}></p>
    </div>
  );
}
